script: |
  super -f text -I q1177.spq | sort > q1177.out

inputs:
  - name: q1177.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col0 NOT BETWEEN + - col0 * + - 94 / - ( + col2 ) - + 82 AND 62 + + 5 * + - col2 * + - col0;
  - name: tab1

outputs:
  - name: q1177.out
    data: |
      51	14	96
      85	5	59
      91	47	68
